import Logo from '../images/logo.png';
import facebook from '../images/fac.png';
import twitter from '../images/twt.png';
import linkedin from '../images/in.png';

function Footer() {
    
    return (
        <div className='footer'>
            <ScrollToTop smooth 
            smooth
            viewBox="0 0 24 24"
            svgPath="M9 19c-4.286 1.35-4.286-2.55-6-3m12 5v-3.5c0-1 .099-1.405-.5-2 2.791-.3 5.5-1.366 5.5-6.04a4.567 4.567 0 0 0 -1.333 -3.21 4.192 4.192 0 00-.08-3.227s-1.05-.3-3.476 1.267a12.334 12.334 0 0 0 -6.222 0C6.462 2.723 5.413 3.023 5.413 3.023a4.192 4.192 0 0 0 -.08 3.227A4.566 4.566 0 004 9.486c0 4.64 2.709 5.68 5.5 6.014-.591.589-.56 1.183-.5 2V21" />
            <div className='foot-nav-1'>
            <img className='logo-1' src={Logo} alt='logo'/><br/>
            <img className='f-s-icon' src={facebook} alt='facebook'/>
            <img className='f-s-icon' src={twitter} alt='twitter'/>
            <img className='f-s-icon' src={linkedin} alt='linkedin'/>
            </div>
            <a href='/' className='foot-nav' style={{marginLeft:'5vw'}}>HOME</a>
            <a href='/kid' className='foot-nav'>KIDS</a>
            <a href='/tech' className='foot-nav'>TECHNOLOGY</a>
